import React from 'react';
import {useState} from "react";
import Carousel from "./Carousel";

const Test = () => {

    const [tests, setTests] = useState([
        {id:1, question: 'Capital of Poland?', answer: 'Warshaw'},
        {id:2, question: 'Capital of Ukraine?', answer: 'Kyiv'},
        {id:3, question: 'Capital of Turkey?', answer: 'Ankara'},
        {id:4, question: 'Capital of Saqartvelos?', answer: 'Tbilisi'},
        {id:5, question: 'Capital of Great Britain?', answer: 'London'},
    ])

    return (
            <div>

                <Carousel>

                    <div className='item item-1'>
                        <p>Capital of Poland?</p>
                        <input/>
                    </div>

                    <div className='item item-2'>Capital of Ukraine?</div>
                    <div className='item item-3'>Capital of Turkey?</div>
                    <div className='item item-3'>Capital of Saqartvelos?</div>
                    <div className='item item-3'>Capital of Great Britain?</div>
                </Carousel>

            </div>
    );
};

export default Test;
